import { Typography } from '@material-ui/core';
import { IconButton } from '@mui/material';
import React from 'react';
import { Close} from '@mui/icons-material';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import useStyles from './style';
import ButtonBase from '@material-ui/core/ButtonBase';


// eslint-disable-next-line react/prop-types
function Menu({onClose, itemPressed, customRefs ,onClick}) {
	const renderItem=(text,Icon)=>{
		return (
			<div style={{width:'10px'}}>
				<ButtonBase onClick={onClick}>
					<div style={{display:'flex',flex:1,flexDirection:'row',justifyContent:'space-around',alignItems:'center',backgroundColor:'red'}}>
						<div style={{display:'flex', flexDirection:'row',flex:1,alignItems:'center'}}>
							<Icon className={classes.icon}></Icon>
							<Typography className={classes.item}>{text}</Typography>
						</div>
						<ArrowForwardIosIcon className={classes.icon}></ArrowForwardIosIcon>
					</div>
				</ButtonBase>
			</div>

		);
	};
	const classes = useStyles();
	const menuItems = ['About', 'Projects', 'contact'];
	return (
		<div className={classes.menu}>
			<IconButton onClick={onClose} className={classes.close} >
				<Close className={classes.icon}/>
			</IconButton>

			{renderItem(menuItems[0],AccountCircleIcon,()=>{itemPressed(customRefs[0]);}) }
			<IconButton>
				<Typography className={classes.item}>{menuItems[1]}</Typography>
			</IconButton>
			<IconButton>
				<Typography className={classes.item}>{menuItems[2]}</Typography>
			</IconButton>
		</div>
	);
}
export default Menu;
